import { instance } from "../services"

export const getDataMenu = async(type, page) => {
    const response = await instance.get(`https://www.soldout.co.kr/api/v3/search/get-item-list?&typeGb=goods&pageIndex1&pageSize=24&keyword=${type}`)
    const data = response.data.data.product_info.list.map(
        (item) => ({
            code: item.model_no,
            type: item.brand_name_eng,
            min_price: item.min_price,
            name: item.name_eng,
            img: item.image_path,
        })
    )


    return data
}
